column8:
オートゲージスモークメーターシリーズ！<br>メーターはデジタルとアナログのデュアル表示！<br>文字盤は、配線を変える事によりホワイト、アンバーの2色からお選びいただけます。<br><br>【うれしい3つの特典】<br>特典1：メーターフードプレゼント<br>特典2：メーターマウントプレゼント<br>特典3：オリジナルステッカープレゼント<br><br><br>ターボの加給圧を計測します。<br>（RANGE/-1.0Bar～2.0Bar）<br><br><br>●スモークレンズ<br>OFFの状態だと真っ黒ですが、キーをONにすると文字盤や指針が浮かび上がってくるタイプのメーターです。<br>バックライトには高輝度ホワイト&アンバーLEDを使用！<br>鮮やかな発色で視認性を高めます。<br><br><br>■仕様<br>メーカー：オートゲージ（Auto Gauge）<br>品番：52-AGBOBLED-WA<br>種類：ブースト計<br>レンジ：-1.0Bar～2.0Bar<br>外径：52φ<br>バックライト：高輝度ホワイトLED&アンバーLED<style type="text/css">
